      method: 'GET',
      // credentials: 'include',
    })
    .then((resp) => {
      console.log(resp);
    })
  }

  return (
    <div>
      <h1>Profile</h1>
      <h1>hello</h1>
      <button onClick={linkHandler}>
        Link to Spotify
      </button>
      <h1>hello</h1>
    </div>
  )
};

export default Dashboard;
